// src/pages/ContactPage.js
import React from 'react';
import './global.css';

const ContactPage = () => {
  return (
    <div className="container">
      <section className="section light">
        <div className="content">
          <h1>Contact Us</h1>
          <p>
            Get in touch with us to explore how we can assist you in achieving your goals in Dubai. Whether you have inquiries about our services, want to discuss partnership opportunities, or simply need more information, our team is here to provide personalized assistance and support.
          </p>
        </div>
      </section>
    </div>
  );
};

export default ContactPage;
